{
  "translationLines": [
    {
      "lineNumber": 17091,
      "originalJapaneseLine": "　付き合ってる人なんかいたんだ。意外……」",
      "translatedEnglishLine": "You have someone you're dating? That's surprising..."
    },
    {
      "lineNumber": 17092,
      "originalJapaneseLine": "「…………そーだ。そーだそーだ。カスミだ。",
      "translatedEnglishLine": "...That's right. That's right, Kasumi."
    },
    {
      "lineNumber": 17093,
      "originalJapaneseLine": "　マリアんとこの子だったな」",
      "translatedEnglishLine": "She's the girl from Maria's place."
    },
    {
      "lineNumber": 17094,
      "originalJapaneseLine": "「顔と身体は覚えてたんだがな！",
      "translatedEnglishLine": "I remembered her face and body, though!"
    },
    {
      "lineNumber": 17095,
      "originalJapaneseLine": "　名前を忘れてたわ。がはははは」",
      "translatedEnglishLine": "But I forgot her name. Hahaha!"
    },
    {
      "lineNumber": 17096,
      "originalJapaneseLine": "「さいってー…………」",
      "translatedEnglishLine": "You're the worst..."
    },
    {
      "lineNumber": 17097,
      "originalJapaneseLine": "「発注してたネジ、届きましたー！」",
      "translatedEnglishLine": "The screws we ordered have arrived!"
    },
    {
      "lineNumber": 17098,
      "originalJapaneseLine": "「六号車と九号車、部品が来ました！",
      "translatedEnglishLine": "Parts for car number six and nine have arrived!"
    },
    {
      "lineNumber": 17099,
      "originalJapaneseLine": "　作業班、休憩終了です！」",
      "translatedEnglishLine": "Work team, break is over!"
    },
    {
      "lineNumber": 17100,
      "originalJapaneseLine": "「はーい！」",
      "translatedEnglishLine": "Yes!"
    },
    {
      "lineNumber": 17101,
      "originalJapaneseLine": "「おぉ……やってるな」",
      "translatedEnglishLine": "Oh... they're working hard."
    },
    {
      "lineNumber": 17102,
      "originalJapaneseLine": "「あ……総統さん。",
      "translatedEnglishLine": "Ah... Commander."
    },
    {
      "lineNumber": 17103,
      "originalJapaneseLine": "　マリア工場長なら外していますが」",
      "translatedEnglishLine": "Factory manager Maria is not here right now though."
    },
    {
      "lineNumber": 17104,
      "originalJapaneseLine": "「あぁ、ただフラッと来ただけだ。",
      "translatedEnglishLine": "Ah, I just dropped by casually."
    },
    {
      "lineNumber": 17105,
      "originalJapaneseLine": "　しかし、作業の指揮とかは君がやっているのだな」",
      "translatedEnglishLine": "But you're the one giving the work orders, right?"
    },
    {
      "lineNumber": 17106,
      "originalJapaneseLine": "「工場長がいる時は補佐くらいのものですが。",
      "translatedEnglishLine": "When the factory manager is here, I only assist."
    },
    {
      "lineNumber": 17107,
      "originalJapaneseLine": "　他にする者がいないので」",
      "translatedEnglishLine": "There’s no one else to do it."
    },
    {
      "lineNumber": 17108,
      "originalJapaneseLine": "「……それに、工場長はたまに、",
      "translatedEnglishLine": "...Also, sometimes the factory manager,"
    },
    {
      "lineNumber": 17109,
      "originalJapaneseLine": "　他人に指導や指示をするのに",
      "translatedEnglishLine": "when instructing or directing others,"
    },
    {
      "lineNumber": 17110,
      "originalJapaneseLine": "　向いていない時があるというか……」",
      "translatedEnglishLine": "she's not really suited for it, you could say..."
    },
    {
      "lineNumber": 17111,
      "originalJapaneseLine": "「マリアが？　そうなのか」",
      "translatedEnglishLine": "Maria? Is that so?"
    },
    {
      "lineNumber": 17112,
      "originalJapaneseLine": "「その……あの方は天才なので。",
      "translatedEnglishLine": "Well... she's a genius."
    },
    {
      "lineNumber": 17113,
      "originalJapaneseLine": "　頭と言葉の回転が速すぎて……",
      "translatedEnglishLine": "Her mind and speech operate too fast..."
    },
    {
      "lineNumber": 17114,
      "originalJapaneseLine": "　資質のない者にはついていけないというか……」",
      "translatedEnglishLine": "so those without the aptitude just can't keep up..."
    },
    {
      "lineNumber": 17115,
      "originalJapaneseLine": "「確かにあいつの言ってる事は",
      "translatedEnglishLine": "Certainly, what she says"
    },
    {
      "lineNumber": 17116,
      "originalJapaneseLine": "　ちょくちょく分からん」",
      "translatedEnglishLine": "is often hard to understand."
    },
    {
      "lineNumber": 17117,
      "originalJapaneseLine": "「天才って言われるとなんか違和感あるが……",
      "translatedEnglishLine": "Being called a genius feels a bit strange though..."
    },
    {
      "lineNumber": 17118,
      "originalJapaneseLine": "　ただの機械オタクだろ」",
      "translatedEnglishLine": "She’s just a machine geek, right?"
    },
    {
      "lineNumber": 17119,
      "originalJapaneseLine": "「とんでもないです。",
      "translatedEnglishLine": "That's not true at all."
    },
    {
      "lineNumber": 17120,
      "originalJapaneseLine": "　人間の技術が機械を扱えるようになったのは、",
      "translatedEnglishLine": "Human technology being able to handle machines"
    },
    {
      "lineNumber": 17121,
      "originalJapaneseLine": "　あの方の力と言っても過言ではないはずです」",
      "translatedEnglishLine": "is largely thanks to her ability, you could say."
    },
    {
      "lineNumber": 17122,
      "originalJapaneseLine": "「恐らく、歴史に残るレベルの天才ですよ。",
      "translatedEnglishLine": "She’s probably a genius on a scale that will go down in history."
    },
    {
      "lineNumber": 17123,
      "originalJapaneseLine": "　凡人には翻訳が必要、というだけです」",
      "translatedEnglishLine": "Normal people just need translation to understand her."
    },
    {
      "lineNumber": 17124,
      "originalJapaneseLine": "「ほー……なんだ、尊敬してるのか」",
      "translatedEnglishLine": "Oh... so you respect her, huh?"
    },
    {
      "lineNumber": 17125,
      "originalJapaneseLine": "「それはもちろん。",
      "translatedEnglishLine": "Of course."
    },
    {
      "lineNumber": 17126,
      "originalJapaneseLine": "　私たちは、工場長の考えを実現させるために……」",
      "translatedEnglishLine": "We are here to make the factory manager's ideas a reality..."
    },
    {
      "lineNumber": 17127,
      "originalJapaneseLine": "「たっ、大変です！　カスミさん！",
      "translatedEnglishLine": "I-it's urgent! Kasumi!"
    },
    {
      "lineNumber": 17128,
      "originalJapaneseLine": "　マッ、マリア工場長の連絡です！」",
      "translatedEnglishLine": "It's a message from factory manager Maria!"
    },
    {
      "lineNumber": 17129,
      "originalJapaneseLine": "「……………ッ……！」",
      "translatedEnglishLine": "......!"
    },
    {
      "lineNumber": 17130,
      "originalJapaneseLine": "ざわり……と、周囲がどよめいた。",
      "translatedEnglishLine": "A murmur... the surroundings grumbled nervously."
    },
    {
      "lineNumber": 17131,
      "originalJapaneseLine": "「なんだ？　なんだなんだ？」",
      "translatedEnglishLine": "\"What is it? What's going on?\""
    },
    {
      "lineNumber": 17132,
      "originalJapaneseLine": "「その……メモを、預かっていますが……」",
      "translatedEnglishLine": "\"Um... I have a memo here...\""
    },
    {
      "lineNumber": 17133,
      "originalJapaneseLine": "「拝見、します…………」",
      "translatedEnglishLine": "\"Let me see it...\""
    },
    {
      "lineNumber": 17134,
      "originalJapaneseLine": "固唾を呑んで周囲が見守る中、",
      "translatedEnglishLine": "Everyone watched with bated breath,"
    },
    {
      "lineNumber": 17135,
      "originalJapaneseLine": "カスミはメモをゆっくりと開いて、目を通した。",
      "translatedEnglishLine": "Kasumi slowly opened the memo and read it."
    },
    {
      "lineNumber": 17136,
      "originalJapaneseLine": "「っ、あ…………！」",
      "translatedEnglishLine": "\"Ah...!\""
    },
    {
      "lineNumber": 17137,
      "originalJapaneseLine": "「カ、カスミさん！　もしかして……」",
      "translatedEnglishLine": "\"K-Kasumi! Could it be...\""
    },
    {
      "lineNumber": 17138,
      "originalJapaneseLine": "「…………全作業員、作業中止！",
      "translatedEnglishLine": "\"...All workers, stop work!"
    },
    {
      "lineNumber": 17139,
      "originalJapaneseLine": "　仕様…………仕様変更です！」",
      "translatedEnglishLine": "Specification... specification changes!\""
    },
    {
      "lineNumber": 17140,
      "originalJapaneseLine": "「いやあああぁぁぁぁぁぁっ！」",
      "translatedEnglishLine": "\"Nooooooo!\""
    }
  ]
}

